    function __set(QuoteInfo memory quote_) private {
        bytes32 _key = keccak256(
            abi.encodePacked(quote_._ref._left, quote_._ref._right)
        );
        QuoteInfo memory _quote = _quotes[_key];
        if (_quote._source != quote_._source) {
            _clear(quote_._ref._left, quote_._ref._right);
            _quote._ref._left = quote_._ref._left;
            _quote._ref._right = quote_._ref._right;
            _quote._source = quote_._source;
            _quotetoquotes[quote_._ref._left].insert(quote_._ref._right);
            _quotetoquotes[quote_._ref._right].insert(quote_._ref._left);
        }
        _quote._timestamp = bytes4(bytes32(block.number));
        if (
            _quote._quotemin == quote_._quotemin &&
            _quote._quoteavg == quote_._quoteavg &&
            _quote._quotemax == quote_._quotemax
        ) return;
        _quote._quotemin = quote_._quotemin;
        _quote._quoteavg = quote_._quoteavg;
        _quote._quotemax = quote_._quotemax;
        _quotes[_key] = _quote;
    }

    function _clear(address left_, address right_)
        private
    {
        bytes32 _key = keccak256(abi.encodePacked(left_, right_));
        QuoteInfo memory _quote = _quotes[_key];
        if (_quote._source == QuoteSource.None) return;
        else if (_quote._source == QuoteSource.ChainLink)
            __chainlinkClear(left_, right_);
        //else if (_quote._source==QuoteSource.ComplexStatic||_quote._source==QuoteSource.ComplexDynamic)
        //    __complexClear(left_,right_);
        _quotetoquotes[_quote._ref._left].remove(_quote._ref._right);
        _quotetoquotes[_quote._ref._right].remove(_quote._ref._left);

        delete _quotes[_key];
    }

    /////////////////////////////////////////////////////////////////////////////////////////
    //      ChainLink
    /////////////////////////////////////////////////////////////////////////////////////////

    function chainlinkSet(
        address left_,
        address right_,
        address feedaddress_
    ) external onlyContractsOrOperators {
        bytes32 _key = keccak256(abi.encodePacked(left_, right_));

        AggregatorV3Interface _feed = AggregatorV3Interface(feedaddress_);
        _chainlinks[_key] = _feed;

        QuoteInfo memory _quote;
        _quote._ref._left = left_;
        _quote._ref._right = right_;
        _quote._source = QuoteSource.ChainLink;
        (
            uint256 _quotemin,
            uint256 _quoteavg,
            uint256 _quotemax
        ) = __chainlinkReadOnly(_quote);
        _quote._quotemin = UInt256ToUInt64(_quotemin);
        _quote._quoteavg = UInt256ToUInt64(_quoteavg);
        _quote._quotemax = UInt256ToUInt64(_quotemax);
        __set(_quote);
    }

    function __chainlinkClear(address left_, address right_) private {
        bytes32 _key = keccak256(abi.encodePacked(left_, right_));
        delete _chainlinks[_key];
    }

    function __chainlinkReadOnly(QuoteInfo memory quote_)
        private
        view
        returns (
            uint256,
            uint256,
            uint256
        )
    {
        bytes32 _key = keccak256(
            abi.encodePacked(quote_._ref._left, quote_._ref._right)
        );
        (, int256 __answer, , , ) = _chainlinks[_key].latestRoundData();
        require(__answer > 0, "Chainlink quote must be positive");
        uint256 _answer = uint256(__answer);
        _answer *= (10**18) / 10**_chainlinks[_key].decimals();
        return (uint256(_answer), uint256(_answer), uint256(_answer));
    }

    function __chainlinkRead(QuoteInfo memory quote_)
        private
        returns (
            uint256,
            uint256,
            uint256
        )
    {
        if (quote_._timestamp != bytes4(bytes32(block.number))) {
            (
                uint256 _quotemin,
                uint256 _quoteavg,
                uint256 _quotemax
            ) = __chainlinkReadOnly(quote_);
            quote_._quotemin = UInt256ToUInt64(_quotemin);
            quote_._quoteavg = UInt256ToUInt64(_quoteavg);
            quote_._quotemax = UInt256ToUInt64(_quotemax);
            __set(quote_);
        }
        return (
            UInt64ToUInt256(quote_._quotemin),
            UInt64ToUInt256(quote_._quoteavg),
            UInt64ToUInt256(quote_._quotemax)
        );
    }

    /////////////////////////////////////////////////////////////////////////////////////////
    //      Static
    /////////////////////////////////////////////////////////////////////////////////////////

    function staticSet(
        address left_,
        address right_,
        uint256 quote_
    ) external onlyContractsOrOperators {
        QuoteInfo memory _quote;
        _quote._ref._left = left_;
        _quote._ref._right = right_;
        _quote._source = QuoteSource.Static;
        _quote._quotemin = _quote._quoteavg = _quote._quotemax = UIntConverter
            .UInt256ToUInt64(quote_);
        __set(_quote);
    }

    function __staticRead(QuoteInfo memory _quote)
        private
