    function complexReadOnly(QuoteRef[][] memory _convs)
        external
        view
        returns (
            uint256,
            uint256,
            uint256
        )
    {
        uint256 _quotemin = 0;
        uint256 _quoteavg = 0;
        uint256 _quoteavgcount = 0;
        uint256 _quotemax = 0;
        for (uint256 i; i < _convs.length; i++) {
            uint256 __quotemin = 10**18;
            uint256 __quoteavg = 10**18;
            uint256 __quotemax = 10**18;
            for (uint256 j = 0; j < _convs[i].length; j++) {
                QuoteRef memory _ref = _convs[i][j];
                (
                    uint256 ___quotemin,
                    uint256 ___quoteavg,
                    uint256 ___quotemax
                ) = readOnly(_ref._left, _ref._right);
                if (___quoteavg == 0) return (0, 0, 0);
                __quotemin = (___quotemin * __quotemin) / 10**18;
                __quoteavg = (___quoteavg * __quoteavg) / 10**18;
                __quotemax = (___quotemax * __quotemax) / 10**18;
            }
            if (_quotemin == 0 || _quotemin > __quotemin)
                _quotemin = __quotemin;
            if (_quotemax == 0 || _quotemax < __quotemax)
                _quotemax = __quotemax;
            if (_quoteavgcount == 0) _quoteavg = __quoteavg;
            else _quoteavg += __quoteavg;
            _quoteavgcount++;
        }

        _quoteavg /= _quoteavgcount;
        return (_quotemin, _quoteavg, _quotemax);
    }

    function __complexSearch(
        address current_,
        address dest_,
        uint256 callstack_,
        QuoteRef[] memory pathused_
    )
        private
        view
        returns (
            QuoteRef[][] memory complex_ // TODO , uint maxquote, uint minquote)
        )
    {
        address[] memory __quotes = _quotetoquotes[current_];
        complex_ = new QuoteRef[][](0);
        for (uint256 i = 0; i < __quotes.length; i++) {
            uint256 j;
            // we check if the conv isnt already used in path / left to right but also right to left
            for (j = 0; j < pathused_.length; j++)
                if (
                    (pathused_[j]._left == current_ &&
                        pathused_[j]._right == __quotes[i]) ||
                    (pathused_[j]._right == current_ &&
                        pathused_[j]._left == __quotes[i])
                ) break;
            // we jump to next if used
            if (j < pathused_.length) continue;

            // did we found the resolution
            if (__quotes[i] == dest_) {
                QuoteInfo storage _quote = _quotes[
                    keccak256(abi.encodePacked(current_, dest_))
                ];
                if (
                    (_quote._source != QuoteSource.ComplexStatic) &&
                    (_quote._source != QuoteSource.ComplexDynamic)
                ) {
                    QuoteRef[] memory newresolution_ = new QuoteRef[](
                        pathused_.length + 1
                    );
                    // returns the path + this node
                    for (j = 0; j < pathused_.length; j++)
                        newresolution_[j] = pathused_[j];
                    newresolution_[j]._left = current_;
                    newresolution_[j]._right = dest_;

                    QuoteRef[][] memory newcomplex_ = new QuoteRef[][](
                        complex_.length + 1
                    );
                    for (j = 0; j < complex_.length; j++)
                        newcomplex_[j] = complex_[j];
                    newcomplex_[complex_.length] = newresolution_;

                    complex_ = newcomplex_;
                }
            }
            if (callstack_ == 0)
                // we stop because if we did the max recursive, we break to check the opposite conversion if possible
                break;
            // we call recursive add our node to path
            QuoteRef[] memory _newpathused = new QuoteRef[](
                pathused_.length + 1
            );
            for (j = 0; j < pathused_.length; j++)
                _newpathused[j] = pathused_[j];
            _newpathused[j]._left = current_;
            _newpathused[j]._right = __quotes[i];
            QuoteRef[][] memory childcomplex_ = __complexSearch(
                __quotes[i],
                dest_,
                callstack_ - 1,
                _newpathused
            );
            if (childcomplex_.length > 0) {
                QuoteRef[][] memory newcomplex_ = new QuoteRef[][](
                    childcomplex_.length + complex_.length
                );
                for (j = 0; j < complex_.length; j++)
                    newcomplex_[j] = complex_[j];
                for (j = 0; j < childcomplex_.length; j++)
                    newcomplex_[complex_.length + j] = childcomplex_[j];

                complex_ = newcomplex_;
            }
        }

        return complex_;
    }

    function complexSearch(address left_, address right_)
        public
        view
        returns (QuoteRef[][] memory complex_)
    {
        return __complexSearch(left_, right_, MAXSTACKCALL, new QuoteRef[](0));
    }

