    function read(address left_, address right_)
        public
        returns (
            uint256,
            uint256,
            uint256
        )
    {
        bytes32 _key = keccak256(abi.encodePacked(left_, right_));
        QuoteInfo storage _quote = _quotes[_key];
        if (_quote._timestamp == bytes4(bytes32(block.number))) {
            emit Resolved(left_, right_);
            return (
                UInt64ToUInt256(_quote._quotemin),
                UInt64ToUInt256(_quote._quoteavg),
                UInt64ToUInt256(_quote._quotemax)
            );
        }
        uint256 _quotemin = 0;
        uint256 _quoteavg = 0;
        uint256 _quotemax = 0;
        if (_quote._source == QuoteSource.ChainLink)
            (_quotemin, _quoteavg, _quotemax) = __chainlinkRead(_quote);
        else if (_quote._source == QuoteSource.Static)
            (_quotemin, _quoteavg, _quotemax) = __staticRead(_quote);
        else if (_quote._source == QuoteSource.Internal)
            (_quotemin, _quoteavg, _quotemax) = __internalRead(_quote);
        //else if (_quote._source == QuoteSource.ComplexStatic ||_quote._source == QuoteSource.ComplexDynamic)
        //    (_quotemin,_quoteavg,_quotemax) =  __complexRead(_quote);
        if (_quoteavg != 0) {
            emit Resolved(left_, right_);
            return (_quotemin, _quoteavg, _quotemax);
        }
        _key = keccak256(abi.encodePacked(right_, left_));
        _quote = _quotes[_key];
        _quotemin = 0;
        _quoteavg = 0;
        _quotemax = 0;
        if (_quote._source == QuoteSource.ChainLink)
            (_quotemin, _quoteavg, _quotemax) = __chainlinkRead(_quote);
        else if (_quote._source == QuoteSource.Static)
            (_quotemin, _quoteavg, _quotemax) = __staticRead(_quote);
        else if (_quote._source == QuoteSource.Internal)
            (_quotemin, _quoteavg, _quotemax) = __internalRead(_quote);
        //else if (_quote._source == QuoteSource.ComplexStatic ||_quote._source == QuoteSource.ComplexDynamic)
        //    (_quotemin,_quoteavg,_quotemax) = __complexRead(_quote);
        if (_quoteavg == 0) {
            emit Unresolved(left_, right_);
            return (0, 0, 0);
        }
        _quotemin = 10**36 / _quotemin;
        _quoteavg = 10**36 / _quoteavg;
        _quotemax = 10**36 / _quotemax;
        emit Resolved(left_, right_);
        return (_quotemin, _quoteavg, _quotemax);
    }

    function convert(uint256 val_, uint256 quote_)
        public
        pure
        returns (uint256)
    {
        return (val_ * quote_) / 10**18;
    }
